import React from "react";
import "./DietaryIcon.css"; // Archivo CSS para estilos personalizados.

// Rutas relativas a la carpeta de íconos
const dietaryIcons = {
  // Restricciones Dietéticas
  vegetarian: require("icons/vegetarian.png"), // FET
  vegan: require("icons/vegan.png"), // FET
  pescatarian: require("../icons/contains_fish.png"), // FET
  ketogenic: require("../icons/keto.png"), // FET
  paleo: require("../icons/paleo.png"), // FET
  primal: require("../icons/primal.png"), // FET
  /*lowFODMAP: require("../icons/low-fodmap.png"),*/
  whole30: require("../icons/whole30.png"),
  /*highProtein: require("../icons/high-protein.png"),*/
  lowCarb: require("../icons/low_carb.png"), // FET
  lowFat: require("../icons/low_fat.png"), // FET
  sugarConscious: require("../icons/sugar_conscious.png"), // FET

  // Intolerancias y Alérgenos
  glutenFree: require("../icons/gluten_free.png"), // FET
  /*dairyFree: require("../icons/dairy-free.png"),*/
  eggFree: require("../icons/egg_free.png"), // FET
  peanutFree: require("../icons/no_nuts.png"), // FET
  treeNutFree: require("../icons/tree-nut-free.png"),
  soyFree: require("../icons/soy_free.png"), // FET
  fishFree: require("../icons/fish_free.png"), // FET
  /*shellfishFree: require("../icons/shellfish-free.png"),*/
  wheatFree: require("../icons/wheat_free.png"), // FET
  sesameFree: require("../icons/sesame_free.png"), // FET
  sulfiteFree: require("../icons/sulfit_free.png"), // FET
  celeryFree: require("../icons/celery_free.png"), // FET
  mustardFree: require("../icons/mustard_free.png"), // FET
  lupinFree: require("../icons/lupin_free.png"), // FET
  molluskFree: require("../icons/mollusk_free.png"), // FET

  // Ícono genérico
  default: require("../icons/default.png"),
};

const DietaryIcon = ({ diet }) => {
  const icon = dietaryIcons[diet] || dietaryIcons.default; // Ícono por defecto si no se encuentra el especificado.
  return (
    <div className="dietary-icon">
      <img src={icon} alt={diet} className="icon-image" />
      <span>{diet}</span>
    </div>
  );
};

export default DietaryIcon;
